import React from 'react'


const UserItem = ({user}) => {
    return (
        <tr>
            <td>
                {user.first_name}
            </td>
            <td>
                {user.last_name}
            </td>
            <td>
                {user.birthday_year}
            </td>
            <td>
                {user.email}
            </td>
        </tr>
    )
}

const UserList = ({users}) => {
    return (
        <table>
            <th>
                First name User
            </th>
            <th>
                Last Name User
            </th>
            <th>
                Birthday year User
            </th>
            <th>
                email User
            </th>
            {users.map((user) => <UserItem user={user} />)}
        </table>
    )
}

export default UserList
